import MenuItem from "./components/MenuItem";

let menuItem = {
  itemId: 1,
  itemPrice: "12",
  itemName: "Lasagne",
  itemDescription:
    "Meat and cheese layered between house-made pasta with bell peppers and onions.",
};

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <MenuItem {...menuItem}></MenuItem>
      </header>
    </div>
  );
}

export default App;
